import React from 'react';
import styled from 'styled-components';

const MainMenu = styled.div`
    margin-top: 3rem;

    & > a + a {
        margin-top: 1rem;
    }
`

function TopMenu() {
    return (
        <MainMenu style={{ marginTop: '3rem' }}>
            <Link href="/">
                <MenuLink>홈</MenuLink>
            </Link>
            <Link href="/movieSearch">
                <MenuLink>영화</MenuLink>
            </Link>
            <Link href="/movieTalk">
                <MenuLink>무비톡</MenuLink>
            </Link>
        </MainMenu>
    )
};

export default TopMenu;
